import React from "react";
import Nmims from "../../assets/Logo.png";
import AdminIcon from "@rsuite/icons/Admin";
import styled, { keyframes } from "styled-components";

const Dashboard = () => {
  return (
    <Wrapper>
      <LogoSection>
        <img src={Nmims} alt="Loading" />
      </LogoSection>
      <NavigationSection>
        <NavItem>
          <p>Company Listing</p>
          <p>Records</p>
          <p>Student Data</p>
          <p>Student Assessments</p>
          <p>View Queries</p>
          <p>Analytics</p>
        </NavItem>
        <Username>
          <AdminIcon />
          <p>Username</p>
        </Username>
      </NavigationSection>
    </Wrapper>
  );
};

export default Dashboard;


const Wrapper = styled.div`
  width: 100vw;
  display: flex;
  color: white;
`;

const LogoSection = styled.div`
  margin-right: 30px;

`;

const NavigationSection = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
  background-color: #af1111;
`;

const NavItem = styled.div`
  display: flex;
  flex-direction: row;
  width: 90%;
  justify-content: center;
  align-items: center;

  p {
    margin: 15px;
    padding: 0px 36px 0px 30px;
    font-size: 16px;
    transition: 0ms.3s ease-in-out all;
    &:hover{
        transform: scale();
    }
  }
`;

const Username = styled.div`
  width: 10%;
  display: flex;
  justify-content: center;
  align-items: center;

  p {
    font-size: 16px;
    margin-top: 5px;
  }
`;
